import React from "react";

export default function About() {
  return (
    <section id="about" className="card" style={{marginTop:18}}>
      <h3 className="section-title">About Advocate Syed Mujahid Pasha</h3>
      <p style={{color:"#374151", lineHeight:1.6}}>
        Advocate Syed Mujahid Pasha (SMR Law Associates) practices in Bangalore with experience across civil, criminal and corporate law. We focus on pragmatic advice, clear drafting, and strong representation.
      </p>
      <p style={{marginTop:10, color:"#6b7280"}}><strong>Office:</strong> K R Puram, Bangalore</p>
      <p style={{marginTop:6, color:"#6b7280"}}><strong>Contact:</strong> 9738483568</p>
    </section>
  );
}
